css:
.style-override .mde-preview {
  font-family: var(--inkdrop-style-override-preview-body);
}
.style-override .mde-preview h1,
.style-override .mde-preview h2,
.style-override .mde-preview h3,
.style-override .mde-preview h4,
.style-override .mde-preview h5,
.style-override .mde-preview h6 {
  font-family: var(--inkdrop-style-override-preview-title);
}
.style-override .mde-preview code,
.style-override .mde-preview kbd,
.style-override .mde-preview pre,
.style-override .mde-preview pre code {
  font-family: var(--inkdrop-style-override-preview-code);
}
.style-override .mde-preview > div {
  max-width: var(--inkdrop-style-override-preview-max-width);
}
.style-override .CodeMirror-scroll {
  max-width: var(--inkdrop-style-override-editor-max-width);
  margin: 0 auto;
}
.style-override .CodeMirror-scroll::-webkit-scrollbar {
  display: none;
}
